contract Staking is Ownable {
    IERC20 public token;  // Reference to the token being staked
    uint256 public stakingRewardsRate = 22; // 22% annual rewards
    uint256 public minStakeAmount = 1000 * 10**16; // Minimum 1000 tokens to stake
    uint256 public maxStakeAmount = 100_000_000 * 10**16; // Maximum 100 million tokens per user
    mapping(address => uint256) public stakedAmounts;
    constructor(address tokenAddress, address initialOwner) Ownable() {  // Added initialOwner argument
        require(tokenAddress != address(0), "Invalid token address");
        token = IERC20(tokenAddress); // Initialize the token contract
        // Set the owner manually
    _transferOwnership(initialOwner);
    }
    function stake(uint256 amount) external {
        require(amount >= minStakeAmount, "Amount below minimum stake");
        require(stakedAmounts[msg.sender] + amount <= maxStakeAmount, "Stake exceeds maximum");
        stakedAmounts[msg.sender] += amount;
        // Transfer tokens from user to contract
        require(token.transferFrom(msg.sender, address(this), amount), "Stake failed");
    }
    // Implement the reward distribution logic (22% annual rewards)
    function calculateRewards(address user) public view returns (uint256) {
        uint256 amountStaked = stakedAmounts[user];
        return (amountStaked * stakingRewardsRate) / 100; // Basic calculation
    }
    function distributeRewards(address user) external {
        uint256 rewards = calculateRewards(user);
        require(token.transferFrom(owner(), user, rewards), "Reward distribution failed");
    }
}

